import React, { Component } from 'react';
import './Regular.css';
import ProjectItem from './ProjectItem.js';





export default class Projects extends React.Component {
	constructor(props) {
		super(props);
	}


	render() {
		let json = this.props.items;
		for(var i = 0; i < json.length; i++) {
		    var obj = json[i];

		    console.log("MY THING: " , obj.id);
		}


		const dataList = Object.entries(this.props.items).map(([id, title, info]) => (
			<div><ProjectItem projectTitle={title}
					projectInfo={info}
					></ProjectItem><br/></div>
			)
		);

	    return (
			<p id="projects_content">
			</p>
	);
	}
}
